import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import Veterinary from '../assets/poster1-pic.jpg'
import Community from '../assets/poster2-pic.jpg'
import ChatBot from '../assets/poster3-pic.jpg'

import 'swiper/css';
import "swiper/css/effect-cards";
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import { EffectCards, Pagination } from 'swiper';

const Cards = () => {

    return (
        <div>
            <Swiper
                effect={"cards"}
                grabCursor={true}
                pagination={{
                    dynamicBullets: true,
                }}
                loop={true}
                slidesPerView={'auto'}
                modules={[EffectCards, Pagination]}
                className="swiper_container"
            >
                <SwiperSlide className='bg-white text-black'>
                    <div class="rounded overflow-hidden shadow-lg dark:shadow-gray-800">
                        <img
                            className="w-full h-[216.58px]"
                            src={Community}
                            alt="Mountain" />
                        <div class="px-6 py-4">
                            <div class="font-bold text-xl mb-2">Community</div>
                            <p class="text-gray-700 dark:text-gray-300 text-base">
                                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus
                                quia, Nonea! Maiores et perfe
                            </p>
                        </div>
                    </div>
                </SwiperSlide>
                <SwiperSlide className='bg-white text-black'> <div class="rounded overflow-hidden shadow-lg dark:shadow-gray-800">
                    <img
                        class="w-full"
                        src={ChatBot}
                        alt="Mountain" />
                    <div class="px-6 py-4">
                        <div class="font-bold text-xl mb-2">ChatBot</div>
                        <p class="text-gray-700 dark:text-gray-300 text-base">
                            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus
                            quia, Nonea! Maiores et perfe
                        </p>
                    </div>
                </div></SwiperSlide>
                <SwiperSlide className='bg-white text-black'> <div class="rounded overflow-hidden shadow-lg dark:shadow-gray-800">
                    <img
                        class="w-full"
                        src={Veterinary}
                        alt="Mountain" />
                    <div class="px-6 py-4">
                        <div class="font-bold text-xl mb-2">Veterinary</div>
                        <p class="text-gray-700 dark:text-gray-300 text-base">
                            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus
                            quia, Nonea! Maiores et perfe
                        </p>
                    </div>
                </div></SwiperSlide>

            </Swiper>
        </div>
    )
}

export default Cards
